import React from 'react';

export default function Resume() {
    return (
        <div className='resume'>
            <h1>Resume</h1>
            <h2>Programming Languages</h2>
            <div className='card' id='Frontend'>Front-End
                <ul>
                    <li>HTML</li>
                    <li>CSS</li>
                    <li>JavaScript</li>
                    <li>SQL</li>
                    <li>Python</li>
                    <li>Java</li>
                    <li>C#</li>
                </ul>
            </div>
        </div>
    );
}
